import { CanvasMaskPlugin } from "./CanvasMaskPlugin.js";
export async function loadCanvasMaskPlugin(engine, refresh = true) {
    engine.checkVersion("3.9.1");
    await engine.addPlugin(new CanvasMaskPlugin(), refresh);
}
